import React from "react";

import UserItem from "./UserItem";

const UserList = (props) => {
  return (
    <ul>
      {props.users.map((user) => (
        <UserItem key={user.key} name={user.name} age={user.age} />
      ))}
    </ul>
  );
};

export default UserList;
